// (*** Show combo y tabla ***)
$('#combo-cell-number-calls-consumption-detail').select2().one("change", function(e) {
    $("#period").slideDown("slow");
//    showNotificationAmaranNoTime('Para visualizar correctamente los archivos descargados, su equipo debe tener instalado el software apropiado.', '#info-file-type-container', 'smallInfoMessage');
    $("#current-period-calls-table-container").show();
    $("#parentHorizontalTab").slideDown("slow");
})

$('#period').select2().on("change", function(e) {
    if ($("#period :selected").text() == "Período facturado" ) {
        $("#current-period-calls-table-container").hide();
        $("#current-period-internet-table-container").hide();
        $("#billed-period-table-container").slideDown("slow");
        $("#billed-period-internet-table-container").slideDown("slow");
    } else {
        $("#current-period-calls-table-container").slideDown("slow");
        $("#current-period-internet-table-container").slideDown("slow");
        $("#billed-period-table-container").hide();
        $("#billed-period-internet-table-container").hide();
    }
})
// /(*** Show combo y tabla ***)